import './App.css';
import Noticia from './components/Noticia';

function App() {

  const noticias = [
    {
      titulo: "Mejor actor",
      fuente: "Will Smith",
      fecha: "Javier Bardem y Benedict Cumberbatch",
      foto: "taco",
      body: "lorem ipsum"
    },
  ];

  return (
    <div className="App">
      {
        noticias.map(
          (noticia) => (
            <Noticia datos={noticia}/>
          )
        )
      }
    </div>
  );
  }

export default App;
